def plot_sensibility(parameter_name: str, param_values: list[float], all_data: list) -> None:

    colors = ['skyblue', 'red', 'yellow', 'green', 'purple', 'black']
    labels = [f'{parameter_name}={i}' for i in param_values]
    greatest_cplt = max([len(g) for g in all_data])
    padded = [g + [0] * (greatest_cplt - len(g)) for g in all_data]

    for c, g in zip(colors, padded):
        sns.barplot(x=range(greatest_cplt), y=g, color=c)

    legend_patches = [Patch(color=col, label=lab) for col, lab in zip(colors, labels)]
    plt.legend(
        handles=legend_patches,
        title=f"Valeurs de {parameter_name}",
        loc='upper left',   # Position en haut-centre
        bbox_to_anchor=(0.5, 1.10),  # Ajuster la position exacte
        ncol=3,  # Afficher la légende sur 3 colonnes
        frameon=True,  # Ajouter un cadre autour de la légende
        fancybox=True,  # Bordures arrondies
        shadow=False,   # Pas d'ombre pour une légende plus discrète
        handletextpad=0.5,  # Réduire l'espace entre les carrés et le texte
        columnspacing=0.5,  # Réduire l'espace entre les colonnes
        fontsize='small'    # Texte plus petit
    )

    plt.title(f"Average reward par completion ({steps} steps)")
    plt.xlabel("Completions")
    plt.ylabel("Reward Average")
    xticks: range = range(0, greatest_cplt, 100)
    plt.xticks(xticks)
    plt.show()



steps = 10000
plot_sensibility(parameter_name='p', param_values=[0, 0.01, 0.03, 0.1, 0.3, 1], all_data=[p0, p001, p003, p01, p03, p1])